import React from 'react';
import './App.css';
import Logo from './images/Logo.png'
function Nav() {
    return(
        <nav>
           <h3>
               <img src={Logo} width="50em" height="10vh"></img>
           </h3>
           <ul>
                <li>Main Page</li>
                <li>Admin Page</li>
            </ul> 
        </nav>
    );
}

export default Nav;
